import React, { Component } from 'react';

const ServiceBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Services
  </button>
);

const PrixBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Prix
  </button>
);

const PromotionBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Promotions
  </button>
);

const ImageTarifs = ({ position, width, height, top, left }) => (
  <img
    style={{
      position: position,
      width: width,
      height: height,
      top: top,
      left: left
    }}
    src={require('../../img/tarifs.png')}
    alt='Homeimg'
  />
);

const Srvces = ({ position }) => (
  <h1
    style={{
      position: position
    }}
  >
    Services we offer
  </h1>
);

export class Services extends Component {
  render() {
    return (
      <div className='mt-5'>
        <div>
          <ServiceBtn />
          <PrixBtn />
          <PromotionBtn />
        </div>
        <div className='d-flex'>
          <ImageTarifs />
          <div>
            <Srvces />
          </div>
        </div>
      </div>
    );
  }
}

export default Services;
